acqinfo.p:
Dit proces-verbaal bevat twee bepalingen, die in verband met de toekomstige ontwikkeling van het archief niet zonder belang waren, nl.:   


dat door de zorgen van de Algemene Rijksarchivaris een inventaris van de in bewaring gegeven stukken zou worden gemaakt;


dat de stukken, die ná 1840 waren gedateerd, aan de eigenaar moesten worden teruggegeven.

scopecontent.p:
Er werden vier hulpmiddelen ontworpen om het zoeken in deze inventaris te bevorderen nl.:   


de inhoudsopgave, die onder meer verwijst naar de zakelijke inhoud van het familiearchief Fagel en een schematisch overzicht biedt van de aard en indeling ervan;


de index van persoonsnamen, die niet alleen verwijst naar de eigennamen, die in de inventaris worden vermeld, maar ook naar de namen van de correspondenten, die in schriftelijke relatie tot de Fagels stonden en wier namen niet in de inventaris zelf voorkomen. Het betreft hier alleen de namen van correspondenten in de series 'Particuliere Brieven' en 'Brieven van Ministers'. De getallen achter de namen verwijzen naar de nummers van deze inventaris. Aan de hand van deze nummers kan men in het bijzonder ten aanzien van de correspondenten nagaan met welke Fagels en wanneer briefwisseling werd onderhouden;


een overzicht van de onderlinge verhouding der groepen archivalia in het familiearchief Fagel (bijlage I);


de stamboom van de familie Fagel.
